import React from 'react';
import { Box, Button, Typography } from '@mui/material';

interface FileSelectorProps {
  onFileSelect: (fileNumber: number) => void;
}

const FileSelector: React.FC<FileSelectorProps> = ({ onFileSelect }) => {
  const handleFileSelect = (fileNumber: number) => {
    onFileSelect(fileNumber);
  };

  return (
    <Box sx={{ p: 3, textAlign: 'center' }}>
      <Typography variant="h5" sx={{ mb: 3, fontFamily: 'NoiGrotesk', fontWeight: 'bold' }}>
        SÃ©lectionnez un fichier
      </Typography>
      <Box sx={{ display: 'flex', gap: 2, justifyContent: 'center' }}>
        {[1, 2, 3, 4, 5].map((number) => (
          <Button
            key={number}
            variant="contained"
            onClick={() => handleFileSelect(number)}
            sx={{
              fontFamily: 'NoiGrotesk',
              backgroundColor: '#2C3E50',
              '&:hover': {
                backgroundColor: '#34495E'
              }
            }}
          >
            Fichier {number}
          </Button>
        ))}
      </Box>
    </Box>
  );
};

export default FileSelector;
